	insert into tbl_account values (null,(select enrollee_id from tbl_enrollees where stud_id = student_id && status_sy = sy && status_sem = sem),status);
insert into tbl_enrollees values (null,stud_id,status_sy,status_sem,(select course_id from tbl_course where course_desc = course),current_status,dateEnrolled);
 insert into tbl_enrolldetails values ((select enrollee_id from tbl_enrollees where stud_ID = student_ID && status_sy = s_y && status_sem = semester),(select section_id from tbl_section where sectionCode = sectionID && sy = sec_sy && sem = sec_sem && dept_id = (select dept_id from tbl_department where dept_desc = department)),0,0,0,0,0,' ');
	insert into tbl_misc_details values ((select account_id from tbl_account where enrollment_id = (select enrollee_id from tbl_enrollees where stud_id = student_id && status_sy = sy && status_sem = sem)) , (select misc_id from tbl_miscellaneous where misc_description = misc),now());
	insert into tbl_payment values(null , typeP , (select account_id from tbl_account where enrollment_id = (select enrollee_id from tbl_enrollees where stud_id = studentID && status_sy =  syVal && status_sem = semVal)) , amount, orNumber ,dateVal);
insert into tbl_section values (concat(sectionID,(SELECT dept_id from tbl_department where dept_desc = department)),sectionCode,subjectID,sy,sem,(select instructor_id from tbl_instructor where concat(ins_fname,' ',ins_lname) = instructorName) , (select room_id from tbl_rooms where room_desc = roomName), lecDay,lecHours, labDay,labHours,(select room_id from tbl_rooms where room_desc = LabRoom),(SELECT dept_id from tbl_department where dept_desc = department),slots);
